import Navbar from "../navbar/navbar";
import React, { useState, useEffect } from "react";
import "./team.css";
import userIcon from "../../images/Name.png";
import { Link } from "react-router-dom";
import logo from "../../images/a.ico";

import p from "../../images/p.jpg";
import j from "../../images/j.jpg";
import t from "../../images/t.jpg";
import n from "../../images/n.jpg";
import m from "../../images/Alex-MPACKO.jpg";

function Team() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isOpen, setIsOpen] = useState(false);
  const handleToggle = () => setIsOpen(!isOpen);

  useEffect(() => {
    // Check if user is logged in
    const token = localStorage.getItem("token");
    if (token) {
      setIsLoggedIn(true);
    } else {
      setIsLoggedIn(false);
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("token");
    setIsLoggedIn(false);
    // Redirect user to login page after logout
    window.location.href = "/login";
  };

  const handleReserverClick = () => {
    if (!isLoggedIn) {
      // Redirect user to login page if not logged in
      window.location.href = "/login";
    } else {
      window.location.href = "/reserver";
    }
  };

  const handleProfileClick = () => {
    if (!isLoggedIn) {
      // Redirect user to login page if not logged in
      window.location.href = "/login";
    } else {
      window.location.href = "/profile";
    }
  };
  return (
    <div >
      <nav className="Navb ">
        <div className="navhome ">
          <Link to="/home" className="log ">
             <img src={logo} alt="logo" className="logo "  />
          </Link>
          <div className={`nav-toggle`} onClick={handleToggle}>
            ☰
          </div>
          <ul className={`navigation ${isOpen ? 'show' : ''}`}>
            <li>
              <Link to="/home" className="linknav">
                <a className="linknav" href="/home">
                Accueil
                </a>
              </Link>
            </li>
            <li>
              <Link to="/team" className="linknav">
                <a className="linknav" href="/team">
                Équipe
                </a>
              </Link>
            </li>
            <li>
              <Link to="/service" className="linknav">
                <a className="linknav">Services</a>
              </Link>
            </li>
            <li>
              <Link to="/contactus" className="linknav">
                <a className="linknav" href="/contactus">
                  Contactez-Nous
                </a>
              </Link>
            </li>
            <li>
              <Link to="/media" className="linknav">
                <a className="linknav" href="#">
                  Média
                </a>
              </Link>
            </li>
            <li>
              <Link to="/newsletter" className="linknav">
                <a className="linknav" href="#">
                  Newsletter
                </a>
              </Link>
            </li>
          </ul>
          <div>
            <Link
              to="/login"
              onMouseEnter={() => {
                document.querySelector(".profil").classList.add("hover");
              }}
              onMouseLeave={() => {
                document.querySelector(".profil").classList.remove("hover");
              }}
            >
              <img src={userIcon} alt="Profile Picture" className="profil" />
            </Link>
            <Link
              to="/login"
              onMouseEnter={() => {
                document.querySelector(".actionButton").classList.add("hover");
              }}
              onMouseLeave={() => {
                document
                  .querySelector(".actionButton")
                  .classList.remove("hover");
              }}
            >
             {/*<button className="actionButton">Calendrier</button>*/}
            </Link>
          </div>
        </div>
      </nav>
      <div className="afternav">
        <h1 className="afternavtitle">Notre Équipe</h1>
        {/*<p className="equipetitle">Team</p>
        <button className="Contactez-Nous-button">Contact Us</button>*/}
      </div>
      <div className="teamcontent" id="contenudebase">
        <div className="theline">
          <div className="leftLine"></div>
          <h1 id="teamTitle">Nos Avocats</h1>
          <div className="rightLine"></div>
        </div>
        <div className="teampic">
          <div className="avocatpic1">
            <img src={n} alt="lawyer" className="avocat1" id="njifen"/>
            <a href="/team1" className="firstname12">
               NJIFEN MOUNGUETYI Thierry{" "}
            </a>
            {/*<p className="typeavocat1">Lawyer</p>
            <p className="quoet1">
              "Customer service is very important because the client must be
              educated"
            </p>*/}
          </div> 
          <div className="avocatpic">
            <img src={p} alt="lawyer" className="avocat2" id="paulalain"/>
            <a href="/team2" className="firstname2" id="paul" >
                   <span className="rr">NJANKOUO NDAM Paul Alain{" "}</span>
            </a>
            {/*<p className="typeavocat2">Lawyer</p>
            <p className="quoet2">"Clients are our property"</p>*/}
          </div>
        </div>

        <div className="theline">
          <div className="leftLine"></div>
          <h1 id="teamTitle">Nos Juristes</h1>
          <div className="rightLine"></div>
        </div>
        <div className="teampic">
          <div className="avocatpic2">
            <img src={t} alt="lawyer" className="avocat3" id="emmanuel" />
            <a href="/team3" className="firstname14" id="emmanuelV">
                TCHAPGANG Valery Emmanuel {" "}
            </a>
            {/*<p className="typeavocat3">Jurist</p>*/}
          </div>
          <div>
            <img src={j} alt="lawyer" className="avocat4" id="joseph" />
            <a href="/team4" className="firstname11" id="josephN" >
              NGANKEU DEGOUE Joseph Noel
            </a>
            {/*<p className="typeavocat4">Jurist</p>*/}
          </div>
        </div><br/>
        <div className="teampic">
          <div>
            <img src={m} alt="lawyer" className="avocat5" id="stephane" />
            <a href="/team5" className="firstname13" id="stephaneT">
               ALEX MPACKO Tobie Stéphane {" "}
            </a>
          </div>
        </div>

      </div><br/><br/><br/><br/>
    </div>
  );
}

export default Team;
